import React, {Component} from 'react';
import {Platform, StyleSheet, Text, View,Image,Button,NativeModules} from 'react-native';
import LocalBarcodeRecognizer from 'react-native-local-barcode-recognizer';


//获取屏幕信息
var Dimensions = require('Dimensions');
var width = Dimensions.get('window').width;
var height = Dimensions.get('window').height;

const instructions = Platform.select({
  ios: 'Press Cmd+R to reload,\n' + 'Cmd+D or shake for dev menu',
  android:
    'Double tap R on your keyboard to reload,\n' +
    'Shake or press menu button for dev menu',
});

const imageBase64 = "data:image/jpeg;base64,";
type Props = {};
export default class App extends Component<Props> {
  render() {
    return (
      <View style={styles.container}>
        <Text style={styles.welcome}>React Native Local Barcode Recoginzer Demo</Text>
        <Text>Follow images to test:</Text>
        <Image source={{uri:imageBase64}} style={{width:width,height:width}}></Image>
          <Button onPress={()=>{
              this.recoginze();
          }} title={"Recognize"} />
      </View>
    );
  }

  recoginze = async ()=>{
     let result = await LocalBarcodeRecognizer.decode(imageBase64.replace("data:image/jpeg;base64,",""),{codeTypes:['ean13','qr']});
     alert(result);
  }

}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#F5FCFF',
  },
  welcome: {
    fontSize: 20,
    textAlign: 'center',
    margin: 10,
  },
  instructions: {
    textAlign: 'center',
    color: '#333333',
    marginBottom: 5,
  },
});
